text:
- Sử dụng thành thạo các dụng cụ, công cụ cần thiết và kỹ thuật PTN; các thiết bị kỹ thuật của một chuyên ngành sâu công nghệ hóa học;

- Khả năng tư duy hiệu quả và nghiên cứu; có khả năng tiếp cận những hướng phát triển mới và kết nối giữa nghiên cứu quy mô PTN với phát triển ứng dụng;

- Sử dụng tiếng Anh tổng quát và tiếng Anh chuyên ngành (Đạt chuẩn trình độ ngoại ngữ tối thiểu bậc 4/6 khi tốt nghiệp); thành thạo tin học.

- Khả năng tổ chức, lập kế hoạch, làm việc độc lập, làm việc nhóm, giao tiếp hiệu quả.

- Ý thức văn hóa và đạo đức nghề nghiệp, định hướng phát triển nghề nghiệp.
